import { useState } from "react";

const Playlists = ({ name, playlistData }) => {
  const [showModal, setShowModal] = useState(false);
  const switchShowModal = () => {
    setShowModal((prevState) => !prevState);
  };
  const outsideModalClickHandler = () => {
    switchModal((prevState) => !prevState);
  };
  const insideModalClickHandler = (e) => {
    e.stopPropagation();
  };
  return (
    <>
      <div onClick={outsideModalClickHandler} className="modal-wrapper">
        <div
          onClick={(e) => insideModalClickHandler(e)}
          className="modal center-x m-up-6 shadow"
        >
          
        </div>
      </div>
      <div className="addToPlaylist m-up-4 center-x  text-center p-x-2 br-3 create-playlist flex-row align-center is-4">
        <i className="bx bx-play-circle is-primary is-5 m-r-1"></i>
        <p className="m-y-1 regular text-center">{name}</p>
      </div>
    </>
  );
};

export { Playlists };
